PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX p: <http://www.wikidata.org/prop/>
ASK WHERE {
  {
    SELECT ?population2010 WHERE {
      wd:Q183 p:P1082 ?populationStatement2010 .
      ?populationStatement2010 ps:P1082 ?population2010 .
      ?populationStatement2010 pq:P585 ?date2010 .
      FILTER ( YEAR( ?date2010 ) = 2010 )
    }
  }
  {
    SELECT ?latestPopulation WHERE {
      wd:Q183 p:P1082 ?populationStatementLatest .
      ?populationStatementLatest ps:P1082 ?latestPopulation .
      ?populationStatementLatest pq:P585 ?latestDate .
    }
    ORDER BY DESC ( ?latestDate )
    LIMIT 1
  }
  FILTER ( ?latestPopulation >= ?population2010 * 1.01 )
}

