PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?event ?eventLabel ?deathTollNumeric WHERE {
  {
    ?event wdt:P1120 ?deathTollRaw .
    ?event wdt:P585 ?pointInTime .
    FILTER ( ( ?pointInTime >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime ) && ( ?pointInTime <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime ) )
  } UNION {
    ?event wdt:P1120 ?deathTollRaw .
    ?event wdt:P580 ?startTime .
    ?event wdt:P582 ?endTime .
    FILTER ( ( ?startTime <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime ) && ( ?endTime >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime ) )
  } UNION {
    ?event p:P1120 ?statement .
    ?statement ps:P1120 ?deathTollRaw .
    ?event wdt:P585 ?pointInTime .
    FILTER ( ( ?pointInTime >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime ) && ( ?pointInTime <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime ) )
  } UNION {
    ?event p:P1120 ?statement .
    ?statement ps:P1120 ?deathTollRaw .
    ?event wdt:P580 ?startTime .
    ?event wdt:P582 ?endTime .
    FILTER ( ( ?startTime <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime ) && ( ?endTime >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime ) )
  }
  BIND( xsd:decimal ( ?deathTollRaw ) AS ?deathTollNumeric ) OPTIONAL {
    ?event rdfs:label ?eventLabel FILTER ( lang( ?eventLabel ) = "en" )
  }
}
ORDER BY DESC ( ?deathTollNumeric )
LIMIT 1
